import React, { useEffect } from 'react';
import background from '../assets/bg.png'

const useStyles = makeStyles(theme => ({
  toolbarMargin: {
    ...theme.mixins.toolbar,
    marginBottom: "2em"
  },
  logo: {
    height: "6em"
  },
  logoContainer: {
    marginLeft: "4em",
    marginTop: "1em",
    marginBottom: "1em",
    padding: 0,
    "&:hover": {
      backgroundColor: "transparent"
    }
  },
  tabContainer: {
    marginLeft: "auto",
    marginRight: "4em"
  },
  tab: {
    ...theme.typography.tab,
    color: theme.palette.common.gray,
    minWidth: 10,
    marginLeft: "25px"
  },
  menu: {
    backgroundColor: theme.palette.common.blue,
    color: "white",
    borderRadius: "0px"
  },
  menuItem: {
    ...theme.typography.tab,
    opacity: 0.7,
    "&:hover": {
      opacity:1
    },
  },
  serve: {
    margin: "1em",
    fontFamily: "Raleway",
    textTransform: "none",
    fontSize: "1.5em",
    color: theme.palette.common.gray,
  }
}))

const Home = () => {
  const classes = useStyles();

  useEffect(() => {
    document.body.style = `background-image: url("${background}")`;
  }, []);

  return (
    <div style={{margin: "10em"}}>
      hi
    </div>
  );
};

export default Home;
